package statistics.dto;

import lombok.Data;
import statistics.enums.EventType;

import java.io.Serial;
import java.io.Serializable;
import java.nio.file.Files;
import java.nio.file.Path;
import java.nio.file.Paths;
import java.util.Base64;

@Data
public class EventDto implements Serializable {

    @Serial
    private static final long serialVersionUID = 5495723252465834240L;

    /**
     * 이벤트에 포함된 사람수
     */
    private int peopleCount;

    /**
     * 이벤트 발생 시간(Timestamp)
     */
    private long eventTime;

    /**
     * 이벤트 CROP 이미지(BASE64로 인코딩된 PNG 이미지)
     */
    private String image;

    /**
     * 이벤트 타입(e.g. area_crowding)
     */
    //private String type;
    private EventType eventType;

    /**
     * 카메라 ID
     */
    private Integer cameraId;

    /**
     * 카메라 외부 ID
     */
    private String cameraExtId;

    /**
     * 카메라명
     */
    private String cameraName;

    /**
     * 카메라 설명(감시하는 방향 등. 교대방향,신사역 방향,역삼역 방향,양재역 방향)
     */
    private String cameraDesc;

    /**
     * 인스턴스 ID
     */
    private Integer instanceId;

    /**
     * 인스턴스 명
     */
    private String instanceName;

    /**
     * 인스턴스 외부 ID(CVEDIA에 등록된 instance_name)
     */
    private String instanceExtName;

    /**
     * 관제영역 ID
     */
    private Integer areaId;

    /**
     * 관제영역명
     */
    private String areaName;

    /**
     * 관제영역명
     */
    private Integer totalSquareMeter;

    /**
     * 알람 레벨 코드
     */
    private String alarmLevelCode;

    /**
     * 알람 레벨 숫자
     */
    private Integer alarmLevelNumber;

    /**
     * 알람 레벨 설명
     */
    private String alarmLevelDesc;

    /**
     * 영역 외부명
     */
    private String areaExtName;

    /**
     * 비상벨시스템 개소번호
     */
    private String callId;

    /**
     * Tripwire 방향(up/down)
     */
    private String crossingDirection;


    public static void main(String[] args) {
        String str = "";

        byte[] decodedBytes = Base64.getDecoder().decode(str);

        try {
            // 디코딩하려는 파일의 경로
            Path outputPath = Paths.get("/root/skw/Desktop/test.png");

            // 디코딩된 내용을 파일에 저장
            Files.write(outputPath, decodedBytes);

        } catch (Exception e) {

        }
    }
}